css:
@-moz-document domain("warszawawpigulce.pl") {
body {
    background: #111111f2 !important;
}
.content {
    background-color: #111111e8 !important;
    color: #ccc !important;
}

#header {
    background-color: #262626f7 !important;
}

header h1 {
    color: #fff !important;
}

a span {
    color: #ccc !important;
}

#tbl-feed-footer-overlay {
    background-color: #262626f7 !important;
    color: #ccc !important;
    border-top: 0px !important;
}

#tbl-feed-footer-overlay a {
    color: #ccc !important;
}

img.tbl-footer-logo {
    content: url(https://i.imgur.com/YYQnxTR.png) !important;
}

div[id^="attachment_"] {
    background-color: #262626f7 !important;
}

#navigation > ul li:last-child a {
    border-right: 0px !important;
}

#logo {
    background: url(https://i.imgur.com/YYQnxTR.png) no-repeat left center !important;
}

#header a {
    color: #fff !important;
    background-color: #262626f7 !important;
}

article header a {
    color: #fff !important;
}

.thetime {
    color: #d94343
}

.frontTitle {
    background: #0000004a;
}

.postsby {
    background: #0000004a;
}

div#page.single {
    background: #ccc;
}

#s {
    background: #0d0f1a30 !important;
    border: 1px solid #3e3d3bd4;
}

footer {
    background: #111111e8 !important;
}

.copyrights {
    background: #111111e8 !important;
}

.carousel .excerpt {
    border: 0px;
}

.main-header {
    background: #11111147 !important;
}

.secondary-navigation a {
    color: #FFF !important;
    background-color: #000000c9 !important;
    border-right: 1px solid #111 !important;
    border-left: 1px solid #111 !important;
}

.mpcfin {
    background-color: #111111f7;
}

strong
{
    color: #FFF !important
}

blockquote
{
    background-color: #151414c9;
    border-left: 10px solid #111;
}
}
